1. We initialize two arrays with the same length, and initialize a loop counter `i` and `j` to zero.
2. We iterate over the first array `arr1` and look over the second array `arr2` using the nested loop.
3. When we find a element `arr1[i]` that is equal to an element in `arr2` (either at `j` or at some previous iteration), we push the element in the result array and break the inner loop.
4. We return the number of common elements in the result.

This solution is efficient because it uses only the built-in arrays and doesn't any external data structures.

